import './App.css';
import Box from './components/Box';

function App() {
  return (
    <div className='main'>
      <div>
        <Box title='you' />
        <Box title='computer' />
      </div>
      <div>
        <button>✌️</button>
        <button>✊</button>
        <button>✋</button>
      </div>
    </div>
  );
}

export default App;

//1. 박스 2개(타이틀, 사진, 결과)
